import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import './Nav.css';

export default class Nav extends Component {
    render() {
        return (
            <nav>
          <div>
              <ul>
                  <a></a>
                  <Link style={{color: "white"}} to="/">Home</Link>
                  <Link style={{color: "white"}} to="/about">About</Link>
              </ul>
          </div>
        </nav>
        )
    }
}
